        var settings = $.extend({
            eProvinceID: "#province",
            eDistrictID: "#district",
            eSubDistrictID: "#subdistrict",
			eZipcode: "#zipcode", 
			SelectProvince : "10",
			SelectDistrict: "",
			SelectSubDistrict: "",
            ProvinceOptionVal: "PROVINCE_CODE",
			ProvinceOptionTxt: "PROVINCE_NAME",
			DistrictOptionVal: "DISTRICT_NAME",
			DistrictOptionTxt: "DISTRICT_NAME",
			SubDistrictOptionVal: "SUBDISTRICT_NAME",
			SubDistrictOptionTxt: "SUBDISTRICT_NAME",
        }, options );
		
		var methods = {
			UpdateDistrict : function( p ) {
				$(settings.eDistrictID).html('');
				$(dataDistrict).each(function(k, v){
					if( p==v[settings.ProvinceOptionVal] ){
						var selected=(settings.SelectDistrict==v[settings.DistrictOptionVal]) ? 'selected="selected"' : '';
						$(settings.eDistrictID).append("<option "+selected+" value="+v[settings.DistrictOptionVal]+">"+v[settings.DistrictOptionTxt]+"</option>");
					}
				});
			},
			UpdateSubDistrict: function( p, d ){
				$(settings.eSubDistrictID).html('');
				$(dataSubDistrict).each(function(k, v){
					if( p==v[settings.ProvinceOptionVal] && d==v[settings.DistrictOptionVal] ){
						var selected=(settings.SelectSubDistrict==v[settings.SubDistrictOptionVal]) ? 'selected="selected"' : '';
						$(settings.eSubDistrictID).append("<option "+selected+" value="+v[settings.SubDistrictOptionVal]+">"+v[settings.SubDistrictOptionTxt]+"</option>");
					}
				});
			},
			UpdateZipcode: function( p, d, s ){
				$(dataSubDistrict).each(function(k, v){
					if( p==v[settings.ProvinceOptionVal] && d==v[settings.DistrictOptionVal] && s==v[settings.SubDistrictOptionVal] ){
						$(settings.eZipcode).val(v.ZIPCODE);
					}
				});
			}
		};
      
        $(dataProvince).each(function(k, v){
			var selected=(settings.SelectProvince==v[settings.ProvinceOptionVal]) ? 'selected="selected"' : '';
			$(settings.eProvinceID).append("<option "+selected+" value="+v[settings.ProvinceOptionVal]+">"+v[settings.ProvinceOptionTxt]+"</option>");
        });
		
		$(settings.eProvinceID).change(function(){
			var p=$(this).val();
			methods.UpdateDistrict(p);
			methods.UpdateSubDistrict(p, '');
		});
		
		$(settings.eDistrictID).change(function(){
			var p=$(settings.eProvinceID).val();
			var d=$(this).val();
			methods.UpdateSubDistrict(p, d);
		});
		
		$(settings.eSubDistrictID).change(function(){
			var p=$(settings.eProvinceID).val();
			var d=$(settings.eDistrictID).val();
			var s=$(this).val();
			methods.UpdateZipcode(p, d, s);
		});
 
		methods.UpdateDistrict(settings.SelectProvince);
		methods.UpdateSubDistrict(settings.SelectProvince, settings.SelectDistrict);
